import React from 'react'
import ReactDOM from 'react-dom'
import Navbar from "./Navbar.js"
import ChoiceBar from "./ChoiceBar.js"
import Footer from "./Footer.js"

function App() {
  return (
    <div class="App">
      <Navbar />
      <ChoiceBar />
      <Footer />
    </div>
  )
}

export default App;
